import React from 'react';
import styled from 'styled-components';
import Button from './Button';

const Fullscreen = styled.div``;

const AskModalBlock = styled.div``;

const StyledButton = styled(Button)``;
const AskModal = ({
  visible,
  title,
  description,
  confirmText,
  onConfirm,
  onCancel,
}) => {
  return (
    <Fullscreen>
      <AskModalBlock>
        <h2>{title}</h2>
      </AskModalBlock>
    </Fullscreen>
  );
};

export default AskModal;
